    "2016-03-17T20:51:25.004317",nt"name": "iowa-gross-domestic-product-by-quarter-and-industry",nt"isopen":
    true,nt"url": null,nt"notes": "Gross domestic product (GDP) is the measure
    of the market value of all final goods and services produced within Iowa in a particular
    period of time.  In concept, an industry's GDP by state, referred to as its "value
    added", is equivalent to its gross output (sales or receipts and other operating
    income, commodity taxes, and inventory change) minus its intermediate inputs (consumption
    of goods and services purchased from other U.S. industries or imported). The Iowa
    GDP a state counterpart to the Nation's GDP, the Bureau's featured and most comprehensive
    measure of U.S. economic activity. Iowa GDP differs from national GDP for the following
    reasons: Iowa GDP excludes and national GDP includes the compensation of federal
    civilian and military personnel stationed abroad and government consumption of fixed
    capital for military structures located abroad and for military equipment, except
    office equipment; and Iowa GDP and national GDP have different revision schedules.rnrnIowa
    Gross Domestic Product available starting in 2005.  Millions of dollars, seasonally
    adjusted at annual rates.",nt"license_title": "Other License Specified",nt"extras":
